import { defineNuxtPlugin } from '#app/nuxt';
import { useCookie } from '#app/composables/cookie';
import { ofetch } from "ofetch";
export default defineNuxtPlugin((app) => {
  const token = useCookie("token");
  const baseUrl = "https://api.beautymap.ir/api";
  const get = async (url) => await ofetch(
    url,
    {
      baseURL: baseUrl,
      method: "GET",
      parseResponse: JSON.parse,
      headers: {
        "Content-Type": "application/json",
        "Accept": "application/json",
        "Authorization": `Bearer ${token.value ?? ""}`
      }
    }
  );
  const post = async (url, body) => await ofetch(
    url,
    {
      baseURL: baseUrl,
      method: "POST",
      body,
      parseResponse: JSON.parse,
      headers: {
        "Content-Type": "application/json",
        "Accept": "application/json",
        "Authorization": `Bearer ${token.value ?? ""}`
      }
    }
  );
  const put = async (url, body) => await ofetch(
    url,
    {
      baseURL: baseUrl,
      method: "PUT",
      body,
      parseResponse: JSON.parse,
      headers: {
        "Content-Type": "application/json",
        "Accept": "application/json",
        "Authorization": `Bearer ${token.value ?? ""}`
      }
    }
  );
  const destroy = async (url, body) => await ofetch(
    url,
    {
      baseURL: baseUrl,
      method: "DELETE",
      body,
      parseResponse: JSON.parse,
      headers: {
        "Content-Type": "application/json",
        "Accept": "application/json",
        "Authorization": `Bearer ${token.value ?? ""}`
      }
    }
  );
  app.provide("getRequest", (url) => get(url));
  app.provide("postRequest", (url, data) => post(url, data));
  app.provide("putRequest", (url, data) => put(url, data));
  app.provide("deleteRequest", (url, data) => destroy(url, data));
});
